import React, { useState } from 'react';
import { useProgress } from '../../contexts/ProgressContext';

const ComputerTypes = () => {
  const { markTopicComplete } = useProgress();
  const [completed, setCompleted] = useState(false);

  const computerTypes = [
    {
      name: "Microcomputers",
      description: "Personal computers, laptops, and tablets used by individuals",
      characteristics: ["Single user", "Low to medium processing power", "Affordable cost", "Portable options available"],
      examples: ["Desktop PCs", "Laptops", "Tablets", "Smartphones"],
      color: "bg-blue-500"
    },
    {
      name: "Minicomputers",
      description: "Mid-range computers used by small businesses and departments",
      characteristics: ["Multiple users", "Moderate processing power", "Used in scientific research", "More expensive than microcomputers"],
      examples: ["Departmental servers", "Scientific workstations", "Industrial control systems"],
      color: "bg-green-500"
    },
    {
      name: "Mainframe Computers",
      description: "Large, powerful computers used by large organizations for critical applications",
      characteristics: ["High processing power", "Multiple users simultaneously", "High reliability", "Expensive to maintain"],
      examples: ["Banking systems", "Airline reservation systems", "Government databases"],
      color: "bg-purple-500"
    },
    {
      name: "Supercomputers",
      description: "The most powerful computers designed for complex scientific calculations",
      characteristics: ["Extremely high processing power", "Used for research", "Massively parallel processing", "Very expensive"],
      examples: ["Weather forecasting", "Nuclear simulations", "Genome sequencing", "Aerospace modeling"],
      color: "bg-red-500"
    }
  ];

  return (
    <div className="max-w-4xl mx-auto">
      <div className="mb-8">
        <h1 className="text-3xl font-bold text-gray-900 dark:text-white mb-2">Computer Types</h1>
        <p className="text-gray-600 dark:text-gray-300">
          Explore the different categories of computers based on size, power, and usage
        </p>
      </div>

      <div className="space-y-8">
        {computerTypes.map((type, index) => (
          <div key={index} className="module-card">
            <div className="flex items-start mb-6">
              <div className={`${type.color} w-16 h-16 rounded-xl flex items-center justify-center text-white text-2xl mr-6`}>
                {index + 1}
              </div>
              <div className="flex-1">
                <h2 className="text-2xl font-bold text-gray-900 dark:text-white mb-2">{type.name}</h2>
                <p className="text-gray-700 dark:text-gray-300 text-lg">{type.description}</p>
              </div>
            </div>

            <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
              <div>
                <h3 className="text-xl font-semibold text-gray-900 dark:text-white mb-3">Characteristics</h3>
                <ul className="space-y-2">
                  {type.characteristics.map((char, i) => (
                    <li key={i} className="flex items-start">
                      <span className="text-green-500 mr-2">✓</span>
                      <span className="text-gray-700 dark:text-gray-300">{char}</span>
                    </li>
                  ))}
                </ul>
              </div>

              <div>
                <h3 className="text-xl font-semibold text-gray-900 dark:text-white mb-3">Examples</h3>
                <ul className="space-y-2">
                  {type.examples.map((example, i) => (
                    <li key={i} className="flex items-start">
                      <span className="text-blue-500 mr-2">•</span>
                      <span className="text-gray-700 dark:text-gray-300">{example}</span>
                    </li>
                  ))}
                </ul>
              </div>
            </div>
          </div>
        ))}
      </div>

      <div className="text-center mt-8">
        <button
          onClick={() => {
            markTopicComplete('computer-types');
            setCompleted(true);
          }}
          className={`btn-primary px-8 py-3 text-lg ${completed ? 'bg-green-500 hover:bg-green-600' : ''}`}
        >
          {completed ? '✓ Completed' : 'Mark as Complete'}
        </button>
      </div>
    </div>
  );
};

export default ComputerTypes;
